import Typewriter from 'typewriter-effect';

export default function Landing(props) {
    return (
        <div className="auth-parent" onKeyPress={() => {console.log("hi")}}>
            <div className="panel">
                <div className="paneltext">
                <Typewriter
                    options={{
                        autoStart: true,
                        delay: 25,
                        cursor: ""

                    }}
                    onInit={(typewriter) => {
                        typewriter.typeString('William Toth OS').start();
                      }}
                />
                <Typewriter
                    options={{
                        autoStart: true,
                        delay: 25,
                        cursor: ""

                    }}
                    onInit={(typewriter) => {
                        typewriter.pauseFor(1000).typeString("Copyright (c) 2022, All Rights Reserved")
                            .start();
                      }}
                />
                <Typewriter
                    options={{
                        autoStart: true,
                        delay: 25,
                        cursor: ""

                    }}
                    onInit={(typewriter) => {
                        typewriter.pauseFor(3000).typeString("Version 1.0")
                            .start();
                      }}
                />
                <br />
                <Typewriter
                    options={{
                        autoStart: true,
                        delay: 25,
                        cursor: ""

                    }}
                    onInit={(typewriter) => {
                        typewriter.pauseFor(4000).typeString("Battery pack: 98% ok")
                            .start();
                      }}
                />
                </div>
            </div>
        </div>
    )
}
